import "./App.css";
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import BookList from "./components/bookList/bookList";
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<BookList />}></Route>
      </Routes>
      <div></div>
    </Router>
  );
}

export default App;
